import React from 'react';
import { Github, Twitter, Linkedin } from 'lucide-react';

const SocialLinks = () => {
  const socialLinks = [
    {
      name: 'GitHub',
      url: 'https://github.com/ValentinaPasqual',
      icon: <Github size={20} />
    },
    {
      name: 'Twitter',
      url: 'https://twitter.com/valepasqual',
      icon: <Twitter size={20} />
    },
    {
      name: 'LinkedIn',
      url: 'https://www.linkedin.com/in/valentina-pasqual-96791017b/',
      icon: <Linkedin size={20} />
    },
    {
      name: 'Google Scholar',
      url: 'https://scholar.google.com/citations?user=EVUFJkAAAAAJ&hl',
      icon: <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
        <path d="M12 2H2v10h10V2z"/>
        <path d="M5 12v10h10V12"/>
        <path d="M12 2h10v10H12"/>
        <path d="M19 12v10"/>
      </svg>
    },
    {
      name: 'Figshare',
      url: 'https://figshare.com/authors/Valentina_Pasqual/10212998',
      icon: <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
        <path d="M12 2v20"/>
        <path d="M17 5H9.5a3.5 3.5 0 0 0 0 7h5a3.5 3.5 0 0 1 0 7H6"/>
      </svg>
    },
    {
      name: 'ORCID',
      url: 'https://orcid.org/0000-0001-5931-5187',
      icon: <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
        <circle cx="12" cy="12" r="10"/>
        <path d="M12 6v8"/>
        <path d="M12 18h.01"/>
      </svg>
    }
  ];

  return (
    <div className="w-full max-w-4xl mx-auto">
      <div className="book-4 p-6 rounded-lg shadow-md mb-8">
        <h2 className="text-xl font-semibold mb-4">Connect with Me</h2>
        
        <div className="social flex items-center justify-center gap-6">
          {socialLinks.map((link, index) => (
            <a 
              key={index}
              href={link.url}
              target="_blank"
              rel="noopener noreferrer"
              className="text-gray-700 hover:text-gray-900 transition-colors duration-200"
              aria-label={link.name}
            >
              {link.icon}
            </a>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Contacts;
